import { Food } from "../models/Food";
import { Meal } from "../models/Meal";
import { User } from "../models/User";
import { Step } from "../models/Step";
import {Ingredient} from "../models/Ingredient";

export function getMeals(): Meal[] {

    const image : string = "data:jpg;base64,";
    const foods: Food[] = getFoods();

     let paella: Meal = new Meal(
        "1",
        "Paella",
        "A Spanish rice dish.",
        image,
        60,
        [
            new Ingredient("1", foods[0], "g", 200),
            new Ingredient("2", foods[1], "g", 100),
            new Ingredient("3", foods[2], "g", 100),
            new Ingredient("4", foods[3], "g", 100),
            new Ingredient("5", foods[4], "g", 100),
            new Ingredient("6", foods[5], "g", 10),
            new Ingredient("7", foods[6], "g", 10),
        ],
        "main course",
        [
            new Step("1", "Boil water", 5, 30),
            new Step("2", "Cook pasta", 5, 30),
            new Step("3", "Serve", 5, 30),
        ],
            "easy"
     );

    let spaghetti: Meal = new Meal (
        "2",
        "Spaghetti",
        "A pasta dish.",
        image,
        30,
        [
            new Ingredient("10", foods[7], "g", 200),
            new Ingredient("11", foods[8], "g", 100),
            new Ingredient("12", foods[3], "g", 100),
            ],
        "main course",
        [
            new Step("1", "Boil water", 5, 30),
            new Step("2", "Cook pasta", 5, 30),
            new Step("3", "Serve", 5, 30),
        ],
        "easy"
        );

    let pizza: Meal = new Meal(
        "3",
        "Pizza de la Mama ! Si si ma que bela !",
        "C'est une pizza, un evrai pizza ! Elle est italienne ? Non amricaine ! Je te jure Whallah ! C'est la pizza de la mama ! Si si ma que bela !",
        image,
        250,
        [
            new Ingredient("13", foods[9], "g", 200),
            new Ingredient("14", foods[10], "g", 100),
            new Ingredient("15", foods[3], "g", 100),
        ],
        "main course",
        [
            new Step("1", "Boil water", 5, 30),
            new Step("2", "Cook pasta", 5, 30),
            new Step("3", "Serve", 5, 30),
        ],
        "easy"
    );

    return [paella, spaghetti, pizza];
};

